import {
  BellOutlined,
  CalendarOutlined,
  OrderedListOutlined,
  PieChartOutlined,
  UserOutlined,
} from "@ant-design/icons";
import { Card, Col, Drawer } from "antd";

export const SideBar = () => {
  return (
    <div>
      <center>
        <Card
          style={{
            width: "200px",
            height: "180px",
            border: "none",
            boxShadow:
              "rgba(0, 0, 0, 0.19) 0px 4px 10px, rgba(0, 0, 0, 0.23) 0px 3px 3px",
            background: "rgb(134, 154, 223)",
            opacity: "0.9",
          }}
        >
          <Card
            style={{
              width: "180px",
              height: "160px",
              border: "none",
              boxShadow:
                "rgba(0, 0, 0, 0.19) 0px 4px 10px, rgba(0, 0, 0, 0.23) 0px 3px 3px",
              background: "rgb(91, 91, 92)",
              opacity: "1",
            }}
          ></Card>
        </Card>
      </center>
    </div>
  );
};
